import React, { Component } from 'react';
import { Box, TextField, Button } from '@material-ui/core';

const styles = {
  container: {
    height: '100%',
    width: '100%',
  },
  loginContainer: {
    width: '100%',
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    marginTop: 50,
  },
  username: {
    width: 220,
    margin: 10,
  },
  password: {
    width: 220,
    margin: 10,
  },
  loginBtn: {
    marginTop: 50,
    backgroundColor: 'green',
  },
};
export default class LoginBox extends Component {
  render() {
    return (
      <Box style={styles.container}>
        <Box
          style={{
            width: '100%',
            alignContent: 'center',
            justifyContent: 'center',
            display: 'flex',
          }}
        >
          {/* 
              fontFamily: 'sans-serif',
    fontSize: 15,
            */}
          <p style={{ fontFamily: 'sans-serif', fontSize: 20, paddingTop: 20 }}>
            Login
          </p>
        </Box>
        <Box style={styles.loginContainer}>
          <TextField style={styles.username} placeholder="Email" />
          <TextField style={styles.password} placeholder="password" />
          <Button style={styles.loginBtn}>Login</Button>
        </Box>
      </Box>
    );
  }
}
